import Home from "./Home";
import {useMetaTitle} from "../hooks/MetaTitle"

const Blogs = () => {
  const siteName = "Mohsinur Rahman"
  const [title, setTitle] = useMetaTitle("Blog Posts");
  
    return (
        <>
            <Home title={title} siteName={siteName} />
        </>
    );
};
  
export default Blogs;
